import React from "react";

const Display = (props) => {
  const { currentGeneral, educationDataList } = props;
  console.log(educationDataList);
  if (!currentGeneral) {
    return <div>No data available</div>;
  }

  const { name, email, phone, city } = currentGeneral;

  return (
    <div>
      <p>Name: {name}</p>
      <p>Email: {email}</p>
      <p>Phone: {phone}</p>
      <p>City: {city}</p>
      {/* Add additional fields as needed 
